import React, { useState } from "react";
import "./Feed.css";
import CommentForm from "./CommentForm";
import rk from './components/rk.jpg'

const Feed = () => {
  const [posts, setPosts] = useState([
    {
      id: 1,
      type: "image",
      contentUrl: "data:image/jpeg;base64,",
      likesCount: 10,
      comments: [
        { username: "User123", text: "Nice photo!" },
        { username: "User456", text: "Love it!" },
      ],
    },
    {
      id: 2,
      type: "video",
      contentUrl: "data:image/jpeg;base64,",
      likesCount: 5,
      comments: [
      { username: "User789", text: "Great video!" },
      { username: "User012", text: "Awesome!" },
      ],
      },
      {
        id: 3,
        type: "image",
        contentUrl: "data:image/jpeg;base64,",
        likesCount: 6,
        comments: [
        { username: "vidhanjain143", text: "Great video!" },
        { username: "yash2880", text: "Awesome!" },
        ],
        
        },
        {
          id: 4,
          type: "image",
          contentUrl: "data:image/jpeg;base64,",
          likesCount: 5,
          comments: [
          { username: "User789", text: "Great video!" },
          { username: "User012", text: "Awesome!" },
          ],
          },
      ]);
      
      const handleLike = (postId) => {
      setPosts((prevPosts) =>
      prevPosts.map((post) =>
      post.id === postId ? { ...post, likesCount: post.likesCount + 1 } : post
      )
      );
      };
      
      const handleComment = (postId, username, text) => {
      setPosts((prevPosts) =>
      prevPosts.map((post) =>
      post.id === postId
      ? { ...post, comments: [...post.comments, { username, text }] }
      : post
      )
      );
      };
      
      return (
        <div className="full">
        <center><p className="un">"Share your favorite moments of Voting with the world! Post your photos, videos, and thoughts here for everyone to see and engage with."
</p></center>
      <div className="feed">
      {posts.map((post) => (
      <div key={post.id} className="post">
      {post.type === "image" ? (
      <img src={post.contentUrl} alt="post" className="post-image" />
      ) : (
      <video src={post.contentUrl} className="post-video" controls />
      )}
      <div className="post-icons">
      <button onClick={() => handleLike(post.id)}>
      <i className="fas fa-heart"></i>
      <span>Likes: {post.likesCount}</span>
      </button>
      <i className="fas fa-comment"></i>
      <span>Comments : {post.comments.length}</span>
      </div>
      <div className="post-comments">
      {post.comments.map((comment, index) => (
      <div key={index}>
      <span className="comment-username">{comment.username}</span>
      <span className="comment-text">{comment.text}</span>
      </div>
      ))}
      </div>
      <CommentForm postId={post.id} onComment={handleComment} />
      </div>
      ))}
      </div>
      </div>
      );
      };

      export default Feed;